const EVENT_TYPES = {
  TRIP_STARTED: 'TRIP_STARTED',
  TRIP_STOPPED: 'TRIP_STOPPED',
  RECORD_GENERATED: 'RECORD_GENERATED',
  RECORD_UPDATED: 'RECORD_UPDATED',
  RECORD_TRANSMISSION_STOPPED: 'RECORD_TRANSMISSION_STOPPED',
  TRIP_STATE_CHANGED: 'TRIP_STATE_CHANGED',
  NOTE_ADDED: 'NOTE_ADDED',
  ERROR_REPORTED: 'ERROR_REPORTED',
  TRIP_REMOVED: 'TRIP_REMOVED',
  TRIP_LOADED: 'TRIP_LOADED',
  DB_STARTED: 'DB_STARTED',
  TRIP_REPORT_GENERATED: 'TRIP_REPORT_GENERATED',
  TRIP_REPORTED: 'TRIP_REPORTED',
};

/**
 * @returns {EVENT_TYPES}
 */
export default EVENT_TYPES;
